           ");
            WriteLiteral(@"                 <span class=""text-danger""></span>
                        </div>
                    </div>
                    <div class=""col-md-3 col-sm-10 input-field"" ng-class=""{ 'has-error' : userForm.LastName.$invalid && !userForm.LastName.$pristine }"">
