                                    </ui-select-choices>
              ");
            WriteLiteral("                  </ui-select>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </form>\r\n        </div>\r\n    </div>\r\n</script>");
